import React from 'react'
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";
import "./ParticleBg.css"

const ParticleBg = () => {
    const particlesInit = async (main) => {
        console.log(main);
        await loadFull(main);
      };

      


  return (
    
    <Particles
      id="tsparticles"
      init={particlesInit}
      options={{
        fullScreen: {
          enable: true,
          zIndex: -1,
        },
        particles: {
          // ... your existing particle options
        },
        background: {
          color: '#000000',
          image: '',
          position: '50% 50%',
          repeat: 'no-repeat',
          size: 'cover',
        },
        interactivity: {
          // ... your existing interactivity options
        },
        retina_detect: true,
        parallax: {
          enable: true,
          force: 2, // You can adjust this value to control the intensity of the parallax effect
        },
      }}
    />
  )
}

export default ParticleBg
